import { NavLink } from "react-router-dom"
import styled from "styled-components";

const NavUnlisted = styled.ul`

  display: flex;
  justify-content: left;
  align-items: center;
  column-gap: 35px;

  li {
    font-size: 1.3rem;
  }
`;

const Header = () => {
    return (
        <header className="bg-olive-green p-5 header text-white">
            <NavUnlisted>
              <NavLink to="/" className="focus:font-bold"><li>Home</li></NavLink>
              <div className="border-l-[1px] vl"/>
              <NavLink to="/shops" className="focus:font-bold"><li className="text-white">Shops</li></NavLink>
              <div className="border-l-[1px] vl"/>
              <NavLink to="cart" className="focus:font-bold"><li className="text-white">Shopping Cart</li></NavLink>
              <div className="border-l-[1px] vl"/>
              <NavLink to="history" className="focus:font-bold"><li className="text-white">History</li></NavLink>
              <div className="border-l-[1px] vl"/>
              <NavLink to="coupons" className="focus:font-bold"><li className="text-white">Coupons</li></NavLink>
            </NavUnlisted>
          </header>
    )
}

export default Header
